### expected behaviour
exported calendar and contact data is successfully imported. have not tried with any other data.

### actual behaviour
nothing is imported. no error message is shown.

### steps to reproduce
1. add some data to calendar or contacts
2. export data for a user in owncloud 4.5 using the account migration tool on the "personal" page
2. import the data in owncloud 5.0 using the user account migration tool on the personal page.
3. go to calendar page, notice that old data has not been imported

the data to be exported is present in the .zip file produced during the export, so the issue seems to be with the import functionality.


### server configuration
operating system:
raspbian (debian) wheezy

web server: 
apache 2

database:
mysql

php version:
php 5.4.4-14

owncloud version:
5.0

### client configuration
browser:
firefox 19.0.2

operating system:
fedora 18

